import styles from "../css/Main.module.css";
import hubaib from "../images/hubaib.jpg";
import hussain from "../images/hussain.jpeg";
import Navbar from "./Navbar";
import React, { useState, useEffect } from "react";

function Main() {
  const [retProducts, setRetProducts] = useState([]);
  useEffect(() => {
    const apiCall = async () => {
      const getProducts = await fetch(
        "http://localhost:5000/products/get-home-products",
        {
          method: "GET",
          credentials: "include",
        }
      );
      const data = await getProducts.json();

      if (data) setRetProducts(data.products);
      console.log(retProducts);
    };
    apiCall();
  }, []);

  return (
    <>
      <Navbar />
      <div className={styles.items_section}>
        {retProducts &&
          retProducts.map((product) => {
            <div className={`card ${styles.card}`} style={{ width: "18rem" }}>
              <img
                src={`http://localhost:5000/productImages/${product.imageURL}`}
                className="card-img-top"
                alt="..."
              />
              <div className="card-body">
                <h5 className="card-title">{product.title}</h5>
                <p className="card-text">Price (Rs): {product.price}</p>
                <p className="card-text">Quantity: {product.quantity}</p>
                <p className="card-text">
                  Rating: 4 <small>/5</small>
                </p>
                <p className="card-text">{product.description}</p>
                <a href="#" className="btn btn-primary">
                  Add to cart
                </a>
              </div>
            </div>;
          })}
        <div className={`card ${styles.card}`} style={{ width: "18rem" }}>
          <img src={hussain} className="card-img-top" alt="..." />
          <div className="card-body">
            <h5 className="card-title">Card title</h5>
            <p className="card-text">
              Some quick example text to build on the card title and make up the
              bulk of the card's content.
            </p>
            <a href="#" className="btn btn-primary">
              Go somewhere
            </a>
          </div>
        </div>

        <div className={`card ${styles.card}`} style={{ width: "18rem" }}>
          <img src={hubaib} className="card-img-top" alt="..." />
          <div className="card-body">
            <h5 className="card-title">Card title</h5>
            <p className="card-text">
              Some quick example text to build on the card title and make up the
              bulk of the card's content.
            </p>
            <a href="#" className="btn btn-primary">
              Go somewhere
            </a>
          </div>
        </div>

        <div className={`card ${styles.card}`} style={{ width: "18rem" }}>
          <img src={hubaib} className="card-img-top" alt="..." />
          <div className="card-body">
            <h5 className="card-title">Card title</h5>
            <p className="card-text">
              Some quick example text to build on the card title and make up the
              bulk of the card's content.
            </p>
            <a href="#" className="btn btn-primary">
              Go somewhere
            </a>
          </div>
        </div>
      </div>
    </>
  );
}

export default Main;
